import styled from "styled-components";

export const Main = styled.main`
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  & > section:nth-child(2) {
    width: 30%;
    div {
      display: flex;
      h2 {
        font-size: 18px;
        font-weight: 700;
        color: #333333;
        text-align: left;
      }
      a {
        font-family: Inter;
        font-size: 14px;
        font-weight: 500;
        line-height: 22px;
        letter-spacing: 0em;
        text-align: left;
      }
    }
  }
`;
